import React from "react";
import '../styles/utility-styles.css'
import '../styles/text-styles.css'
import { Col, Container, Row } from "react-bootstrap";
import Button from "react-bootstrap/Button";

const PersonalAccount = () => {
    return (
        <Container style={{width:'70vw', display:'flex', justifyContent:'center'}}>
            <Row>
                <Col>
                    <div className="display-1" style={{display:'flex', justifyContent:'space-between'}}>
                        Личный кабинет
                        <Button className='button-3 mt-4' style={{border:'none', width:'60%', fontSize:'16px', fontWeight:'700', marginRight:'3%'}}>
                            Войти
                        </Button>
                    </div>
                </Col>
            </Row>
        </Container>
        
    );
};

export default PersonalAccount;
